// authentication.js
import axios from 'axios';
import { GET_ERRORS } from './types';


export const createPetProfile = (pet) => dispatch => {
	axios.post('/api/createpet', pet).then(res => {
		const { pet } = res.data
	})
	.catch(err => {
		dispatch({
			type: GET_ERRORS,
			payload: err.response.data
		});
	});
}
